import React from 'react';


const Bank = () => {


    const inputHandler = (e) => {
        console.log('inputHandler', e.target.value);
    }

    const addHandler = () => {
        console.log('addHandler');
        axios({
            url: 'https://www.nseindia.com/api/search/autocomplete?q=HDFC',
        })
        .then(response => {
           // do something with JSON response data
        })
    }
    return (
        <>
            <input type="search" onChange={(e) => inputHandler(e)} />
            <button onClick={() => addHandler()}>Add</button>
        </>
    )
}
export default Bank;
